import axios from 'axios';
import {REQUEST_LOGIN ,SUCCESSFUL_LOGIN ,FAILED_LOGIN ,LOGGED_OUT } from './types'


export const fetchLogin =(info)=>{
  return dispatch =>({
    type: REQUEST_LOGIN
  })
return axios.post("http://localhost:3000/login", info)

}

export {
  fetchLogin as default
}
